import React from 'react';
import ReactPlayer from 'react-player';
import './Kirby.css';

const KirbyYoutube = () => (
        <div className="Player">
            <ReactPlayer
            url="https://youtu.be/zM-LfbFquuQ"
            controls="on"
            width="650px"
            height="365.625px"
            volume="0.5" />
        </div>
);

export default KirbyYoutube;
